    data: |
      SELECT DISTINCT - ( - 5 ) * cor1.col1 AS col1 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q8386.out
    data: |
      155
      295
      85
